      SELECT ALL * FROM tab2 (FORMAT parquet) WHERE NOT + 62 IN ( - col2 * - col1 * + ( CAST ( - col0 AS INTEGER ) ) + 73, 87 + + col0 );
  - name: tab2

outputs:
